import React from 'react';
import classes from './ListTab.module.css';

const ListTab = (props) => {

	let isListTabClicked;

	if(props.isShown){
		isListTabClicked = 'tabClicked';
	}
	else{
		isListTabClicked = 'tabIsNotClicked';
	}

	classes+=isListTabClicked;

  return (
	  	<li className={classes} onClick={props.showToDoList}>{props.title}</li>
  );
}

export default ListTab;
